                                  <mat-form-field appearance="outline">
                                    <mat-label>Código Inventario</mat-label>
                                    <input matInput [(ngModel)]="codinventariotxt"
                                    formControlName="stamanecodinventario" [formControl]="stamanecodinventario" required >
